    false,nt"url": null,nt"notes": "These data represent all data collected
    from Argo profiling floats through the current month (September 2016). The NOAA
    National Centers for Environmental Information (NCEI) operates the Global Argo Data
    Repository (GADR) as the long-term archive for the International Global Argo Project
    (for additional information about Argo, see http://www.argo.ucsd.edu/). Argo data
    have been archived by NCEI on a monthly basis starting the second quarter of FY
    2003. These data may include real-time and/or delayed-mode profiles of ocean temperature,
    salinity, dissolved oxygen as well as related conductivity and/or pressure measurements.
    These data were collected by Argo profiling floats and other profiling float data
    not directly handled by the Argo data assembly centers. Profiling floats have been
    deployed since 1995 by several research projects.",nt"license_title": null,nt"extras":
